import React from 'react'
import Pattal from './pattal/paper-pattal.jpg'
import './Home.css'

export default function Home() {
  return (
    <div className='homepage'>
      <div>
              <img src={Pattal} className='mainimage'/>
      </div>
      
    </div>
  )
}
